var TwigFilterMethod;

TwigFilterMethod = (function() {
  function TwigFilterMethod(method) {
    this.method = method;
  }

  TwigFilterMethod.prototype.getMethod = function() {
    return this.method;
  };

  return TwigFilterMethod;

})();

module.exports = TwigFilterMethod;
